import React, { useState } from 'react';
import logo from './logo.svg';
import './App.css';
import Navbar from './components/navbar/Navbar';
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";

import Home from './pages/Home';
import HolidayCabins from './pages/HolidayCabins';
import Caravans from './pages/Caravans';
import Facilities from './pages/Facilities';
import Longterm from './pages/Longterm';
import About from './pages/About';
import Contact from './pages/Contact';
import Groups from './pages/Groups';
import Offers from './pages/Offers';


function App(props) {
  const [apiResponse, setapiResponse] = useState("");

  componentWillMount();

  function callAPI() {
    fetch("http://localhost:9000/testAPI")
      .then(res => res.text())
      .then(res => setapiResponse(res));
  }

  function componentWillMount() {
    callAPI();
  }

  return (
    <div className='App'>
      <Navbar />
      <p>Api Response: {apiResponse}</p>
      <Routes>
          <Route exact path='/' exact component={Home}/>
          <Route path='/holidaycabins' component={HolidayCabins}/>
          <Route path='/caravans' component={Caravans}/>
          <Route path='/facilities' component={Facilities}/>
          <Route path='/long-term' component={Longterm}/>
          <Route path='/groups' component={Groups}/>
          <Route path='/about' component={About}/>
          <Route path='/contact' component={Contact}/>
          <Route path='/offers' component={Offers}/>
      </Routes>
    </div>
  )
}

export default App;
